import React, { useState } from 'react';
import './Sidebar.css';

function Sidebar() {
  const [isOpen, setIsOpen] = useState(false);

  const toggleSidebar = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="sidebar-container">
      <button className="toggle-button" onClick={toggleSidebar}>
        {isOpen ? '←' : '→'}
      </button>

      <div className={`sidebar ${isOpen ? 'open' : ''}`}>
        <h2 className="sidebar-title">Navigation</h2>
        <ul className="sidebar-links">
          <li><button className="nav-link" onClick={() => { /* Action for Home */ }}>Home</button></li>
          <li><button className="nav-link" onClick={() => { /* Action for About */ }}>About</button></li>
          <li><button className="nav-link" onClick={() => { /* Action for Services */ }}>Services</button></li>
          <li><button className="nav-link" onClick={() => { /* Action for Contact */ }}>Contact</button></li>
        </ul>
      </div>
    </div>
  );
}

export default Sidebar;
